import {useState} from "react";
import Main from "../../component/js/Main";
import {Button} from "react-bootstrap";
import Test from "../../component/js/Test";

function Body() {
    const [page, setPage] = useState(<Main/>);

    function changePage() {
        setPage(<Test/>);
    }

    return (
        <div>
            page
            <Button onClick={changePage()}>test</Button>
        </div>
    );
}

export default Body;
